import Home from './Home';
import './App.css';
import {BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from "./Navbar/Navbar";

function App() {
  return (
    <div className="App">

      <Router>
        <Routes> 
            <Navbar />
          <Route path="/home">
            <Home />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
